Lots of video Tricks &amp; Trips...

There is everything under the sun and then some. There is colorizing and tinting, images in slow motion, stuttering, stopping and stacking beside each other and inside the limit of your imagination. 

There is everything but the kitsch kitchen sink, but don't throw this crazy baby out with the bath water. There is method to the madness. 

But then this show is so mind-blowing nothing can derail or fail it, stop it or top it. 

