[Pictured: &quot;St. Francis&quot; aka Frances Farmer, &quot;patron saint&quot; of Seattle, WA]

(Friedrich Nietzsche quote, sideways in top right corner) &quot;Is it better to out-monster the monster or to be quietly be devoured?&quot;
_______________________________________________________________________________

(While Eric plays a Gary Numan's &quot;Cars&quot; guitar-solo melody, Courtney says goodnight to the band's 

hometown fans) 

&quot;Thanks a lot for understanding us so fucking well. Thanks a fucking lot, El Aye. We love you.&quot; 

As a girl in the audience repeatedly screams excitedly, the band walks away. 


...Thus goes the greatest rock show on video of all time. 

Teenage Whore is it?

Most highly recommended: I would rate the file quality higher, B+.

This is THE best whole Hole show on video, performance and file quality combined. 

Easily. Courtney is on freaking fire fierce.


The 1999 Big Day Out video is a better quality file, but the performance is nowhere near as intense as 

this. 

Unfortunately there is no full electric, pro video show from 1994-1995. The Unplugged concert has its moments but the best quality available out there is wanting.


My Top Hole Shows (Video):
1. Club Lingerie (1990)
2. Unplugged (1995)
3. Big Day Out (1999)

